import axios from 'axios';
import React, { useState } from 'react';

const defaultData = {
	surname: '',
	name: '',
	time_create: 0,
};

const Testpage = () => {
	const [data, setData] = useState(defaultData);

	const sendData = (e) => {
		e.preventDefault();
		const person = { ...data, time_create: Date.now() };
		axios
			.post('http://localhost:8080/api/user/', person)
			.then(() => setData(defaultData));
	};

	const getData = () => {
		axios.get('http://localhost:8080/api/user/').then((res) => console.log(res.data));
	};

	return (
		<form onSubmit={sendData}>
			<input
				onChange={(e) => setData((prev) => ({ ...prev, name: e.target.value }))}
				value={data.name}
				type='text'
				placeholder='name'
			/>
			<input
				onChange={(e) => setData((prev) => ({ ...prev, surname: e.target.value }))}
				value={data.surname}
				type='text'
				placeholder='surname'
			/>
			<button>send</button>
			<div>
				<br />
				<br />
				<button>Получить посты</button>
			</div>
		</form>
	);
};

export default Testpage;
